import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Form, FormGroup, Button, Container, Table } from "reactstrap";
class Login extends Component {
  state = {};
  render() {
    return (
      <div>
        <Form>
          <FormGroup>
            <Label>name:</Label>
            <Input
              type="text"
              name="name"
              id="name"
              onChange={this.handleChange}
            />
          </FormGroup>
          <FormGroup>
            <Label>address:</Label>
            <Input
              type="textarea"
              name="address"
              id="address"
              onChange={this.handleChange}
            />
          </FormGroup>
        </Form>
      </div>
    );
  }
}

export default Login;
